import React from 'react';
import CharacterList from './CharacterList';
import { StyleSheet, View, Text, Button, Alert,  ScrollView } from 'react-native';


function HomeScreen ({navigation}){
  
         return (
             <View  style={styles.container}>
                 <Text style={styles.text}>Welcome to the Star Wars App!</Text>
                 <Button color='#E2E21C' style={styles.button} title="Character List" onPress={() => navigation.navigate('CahracterList')}></Button>
                 <Button style={styles.button} color='#E2E21C'  title="Favorites List"
                    
                        onPress={() => Alert.alert('Button with adjusted color pressed')}></Button>

             </View>
         );
}

const styles = StyleSheet.create({
     container: {
    flex: 1,
    backgroundColor: '#050201',
    alignItems: 'center',
    justifyContent: 'space-around'
   
     },
     text: {
        color: '#fff'
     }, 
     button: {
        
     },
    });

export default HomeScreen;
